import React from "react";
import Navigation from "../Navigations/HomeNavigation";
import Banner from "../Banners/HomeBanner";

const Header = () => {
  return (
    <div>
      <Navigation activeKey={this.props.activeKey} />
    </div>
  );
};

export default Header;
